export default function Guess(selectedWord,correctLetters){
    return(
        <>
        <div className="mt-4">
           {
            selectedWord.split('').map((letter,i)=>{
                return(
            <span key={i} className='d-inline-block mr-4 '>{correctLetters.includes(letter) ? letter:''}</span>
            )
            })
            }
        </div>
        </>
    )
}
